  render() {
    return (
      <div>
        <form className="ui form">
          <div className="field">
            <label>Name</label>
            <input placeholder="name..." />
          </div>
          <div className="field">
            <label>Phone</label>
            <input placeholder="number phone" />
          </div>
          <div>
              <select>
                  <option>1</option>
                  <option>2</option>
                  <option>3</option>
              </select>
          </div>
          <button type="submit" className="ui button">
            Add
          </button>
        </form>
      </div>
    );
  }
}

export default AddUser;
